Build constraints in Go are expressed in a form of build tags. As you may already know, a build tag is a line comment that begins with // +build and lists the conditions under which a file should be included when compiling and/or testing the project. Basics The following rules are in effect when using build constraints: multiple tags may be listed on the same line multiple lines with build tags may appear, one next to another tags may appear in any kind of source file (not limited to Go) constraints must appear close to the top of the file they may be preceded only by blank lines and other comments a series of build tag lines must be followed by an empty line (to distinguish from the documentation) all this means that in Go files, build constraints must appear only before the package clause. There are also certain rules for writing and grouping build tags: when listed on the same line, space-separated tags are interpreted as OR if an option contains a comma, then it's evaluated as AND of its separated terms allowed symbols for a term are letters, digits, underscores and dots a term can be negated when preceded with an exclamation mark ! when constraints are expressed as multiple lines, the overall result is the AND of individual lines a special tag of // +build ignore can be used to exclude the file from consideration. Here are some examples: a simple build constraint // +build linux,arm windows,386 It results to the following: (linux AND arm) OR (windows AND 386). multiple build tags // +build linux darwing
// +build amd64 It results to the following: (linux OR darwin) AND (amd64) with negation // +build linux darwin,!cgo Which results to (linux) OR (darwin AND NOT cgo). More Control The use of build tags is not limited to only platforms. Other conditions can be expressed in the very same way, for even more advanced control over the compilation. In the example below, we want to offer three tiers in the service – free, silver and gold. Each subsequent tier should include the features from the preceding tier. This is how it can be achieved on the compilation level which may help protect your app against cracking and/or bypassing licensing terms: define a base line, with no tags, in base.go define a the first paid tier, or silver level, in silver.go // +build silver define a the second paid tier, gold, in gold.go // +build silver
// +build gold Notice that we have to list the both tags, silver and gold for the second tier, as we want it to include the features from the preceding tier. That's because of the way how the boolean logic is expressed using the constraints. Passing Tags Now, how to tell compiler about constraints? Build constraints are inferred from three places, two of which you already know: some environment variables, such as GOOS, GOARCH, CGO_ENABLED, etc the suffix of the name of a Go source file when explicitly passed as a special build flag of comma separated values when running build, test and other commands, as -tag tag1,tag2,tag3. Note that the file name's suffix method is mentioned here. That's because, as said earlier, under the hood it works as a build constraint. When a file has a suffix that matches a valid supported operating system, architecture, or a combination of the two, the file is considered to have an implicit build constraint set to the values in the suffix. Using Only Build Tags Having reminded ourselves what a build tag is, let's continue exploring options for cross-platform development. As mentioned earlier, conditions for platform-dependent compilation can be expressed using file name suffixes. In a basic scenario, when the implementation details are different for, say, windows and linux, it's easy to express with mypkg_windows.go and mypkg_linux.go, in addition to mypkg.go. However, what to do when two different platforms have the exact same implementations? One way is to simply have two separate files with same contents. For example, app_darwin.go and app_freebsd.go. But this kind of duplication is not something we normally want, unless we have to. A much better approach is to use build tags for expressing conditions for the compilation process. It helps in making things cleaner and removes the need of duplicating the code. Add a build tag to the file, and give it a meaningful name that does not conflict with the supported operating systems, say app_unix.go: // +build darwin freebsd Now whenever the code is built on each of the mentioned platforms, or with the help of the environment variable GOOS, code will be included in binaries for either of the operating systems.

